import React from 'react';
import styled, { keyframes } from 'styled-components';
import { Headline1 } from 'components/a-commons';

const rotate = keyframes`
  0% {
    transform: translateY(0);
    transform-origin: 50% 50%;
    text-shadow: none;
  }
  100% {
    transform: translateY(-50px);
    transform-origin: 50% 50%;
    text-shadow: 0 1px 0 #0059BD, 0 2px 0 #0059BD, 0 3px 0 #0059BD, 0 4px 0 #0059BD, 0 5px 0 #0059BD, 0 6px 0 #0059BD, 0 7px 0 #0059BD, 0 8px 0 #0059BD, 0 9px 0 #0059BD, 0 50px 30px rgba(0, 0, 0, 0.3);
       text-shadow: 
    /* 0 1px 0 #ccc, 
    0 2px 0 #c9c9c9, 
    0 3px 0 #bbb, 
    0 4px 0 #b9b9b9, 
    0 5px 0 #aaa, 
    0 6px 1px rgba(0,0,0,.1), 
    0 0 5px rgba(0,0,0,.1), 
    0 1px 3px rgba(0,0,0,.3), 
    0 3px 5px rgba(0,0,0,.2), 
    0 5px 10px rgba(0,0,0,.25), 
    0 10px 10px rgba(0,0,0,.2), 
    0 20px 20px rgba(0,0,0,.15); */


  }
`;

const Base = styled.div` 
  display:flex;
  justify-content: center;
  flex-direction: column;
  align-items:center;
  height:100vh;
  background-color:#393e46;
`;

const Fof = styled(Headline1)` 
  animation: ${rotate} 1s cubic-bezier(0.250, 0.460, 0.450, 0.940) both;
  font-size: 12em;
`;

export const NotFound404 = () => {
  return (
    <Base>
      <Fof>
        404
      </Fof>
    </Base>
  )
}
